import React from "react";
import image from '../assets/images/image.jfif'

function Post() {
  return (
    <div>
      <main>
        <div className="head">
                <div className="image"><i class="fas fa-user-circle"></i></div>
                <div className="username">Pranshu_Singh</div>
        </div>
        <div className="body">
            <img src={image} height="500px" width="100%"></img>
        </div>
        <div className="foot"></div>
      </main>
    </div>
  );
}

export default Post;
